import React from 'react';
import cart from "../assets/images/cart.png"

const NavBar = () => {
    return (
        <div className="container">
        <div className={"navbar"}>
            <a href="#" className="navbar__logo">Panto</a>
            <div className="navbar__nav">

                <div className="navbar__nav__item"><a>Furniture</a></div>
                <div className="navbar__nav__item"><a>Shop</a></div>
                <div className="navbar__nav__item"><a>About us</a></div>
                <div className="navbar__nav__item"><a>Contact</a></div>
            </div>
            <div className="navbar__cart">
                <img src={cart} alt=""/>
            </div>
        </div>
        </div>
    );
};

export default NavBar;
